import React from 'react'

const url = "http://localhost:5000/signup"

function postUser() {
    let post = {'username': document.getElementById('username').value}
    fetch (url, {
        headers: {"Content-Type" : "application/json"}, 
        body: JSON.stringify(post),
        mode:"cors",
        method:"post"
    })
}

function Signup() {

    return(
        <div>
        <form>
            <input 
            className='input'
            id='username'
            placeholder='Enter username'>                
            </input>
        </form>
            <button
            className="paybutton"
            onClick={postUser()}>
            SIGN UP
        </button>
        </div>
    )
}

export default Signup
